import React from "react";
import S from './SideBar.module.css'
function SideBar() {
  return(
    <div>
      <div className={S.search}>
        <form>
          <label>Search{' '}</label>
          <input type='text' className={S.breed} autoComplete='off'></input>
        </form>
      </div>

      <div className={S.filter}></div>
    </div>
  )
}
export default SideBar;
